import React from "react";
import img from "../static/twitter-icon-svg.jpg";

// <div className="flex items-center min-h-[56px]">What's happening?</div>
const FeedWth = () => {
  return (
    <div className="flex py-[4px] px-[16px]">
      <div className="flex items-start mr-3 pt-1">
        <img src={img} className="w-12 h-12" />
      </div>
      <div className="flex items-center min-h-[56px] bg-black">
        <input type="text" name="ff" value="" placeholder="What's happening?" />
      </div>
    </div>
  );
};

export default FeedWth;
